function loadData(){var c=$("body");var i=$("#results-header");var n=$("#results-articles");var k=$("#greeting");var l=0;var e=0;n.text("");i.text("");var j="98270563";var a="";var f=new Date();var h=f.getFullYear();var b=f.getMonth()+1;var o="https://zkillboard.com/api/corporationID/"+j+"/year/"+h+"/month/"+b+"/";var g=setTimeout(function(){n.text("Failed to get kill data")},8000);$.ajax({url:o,dataType:"jsonp",success:function(s){n.append("<ul>");var z=s;console.log(z);for(var u=0;u<z.length;u++){articleStr=z[u];var m="http://zkillboard.com/kill/"+articleStr.killID+"/";var t="http://imageserver.eveonline.com/Render/"+articleStr.victim.shipTypeID+"_128.png";var C=[];for(var p=0;p<articleStr.attackers.length;p++){C[p]={pilotkb:"https://zkillboard.com/character/"+articleStr.attackers[p].characterID+"/",corpPic:"http://imageserver.eveonline.com/Corporation/"+articleStr.attackers[p].corporationID+"_32.png",corp:articleStr.attackers[p].corporationName,pilot:articleStr.attackers[p].characterName,pilotP:"http://imageserver.eveonline.com/Character/"+articleStr.attackers[p].characterID+"_32.jpg",shipPic:"http://imageserver.eveonline.com/Type/"+articleStr.attackers[p].shipTypeID+"_32.png",wepPic:"http://imageserver.eveonline.com/Type/"+articleStr.attackers[p].weaponTypeID+"_32.png",corpKB:"http://zkillboard.com/corporation/"+articleStr.attackers[p].corporationID+"/"}}var v='<div class="num">'+articleStr.killTime+"</div>";var q='<div class="dat" id="inv">Involved: '+(articleStr.attackers.length)+'<div id="atta">';for(var A=0;A<C.length;A++){q+='<img src="'+C[A].shipPic+'"><img src="'+C[A].wepPic+'"><a href="'+C[A].corpKB+'"><img src="'+C[A].corpPic+'" alt="'+C[A].corp+'"></a>  <a href="'+C[A].pilotkb+'"><img src="'+C[A].pilotP+'">  '+C[A].pilot+"</a><br>"}q+="</div></div>";var r="http://zkillboard.com/corporation/"+articleStr.victim.corporationID+"/";var y=Number(articleStr.zkb.totalValue).toLocaleString("en",{minimumFractionDigits:2});var B='<div class="dat"><div class="dat2">ISK Value: <div class="num">'+y+'</div></div><div class="dat2"> Points: '+articleStr.zkb.points+"</div>"+v+"</div>";var w="http://imageserver.eveonline.com/Corporation/"+articleStr.victim.corporationID+"_128.png";var x="http://imageserver.eveonline.com/Character/"+articleStr.victim.characterID+"_128.jpg";var d='<div class="image"><a href="'+m+'"><img src="'+t+'"><img src="'+x+'"></a><a href="'+r+'"><img src="'+w+'"></div><div class="ids"><a href="'+m+'">'+articleStr.victim.characterName+'</a><br> Corp: <a href="'+r+'">'+articleStr.victim.corporationName+"</a>"+B+'</div><div class="attackers">'+q+"</li><hr>";if(articleStr.victim.corporationID==j){n.append('<li class="loss">'+d);l+=articleStr.zkb.totalValue}else{n.append('<li class="kill">'+d);e+=articleStr.zkb.totalValue}}n.append("</ul>");$("#diff").text("");if((e-l)>0){$("#diff").append('<div class="kill">Kills: '+Number(e).toLocaleString("en",{minimumFractionDigits:2})+' ISK</div><div class="loss">Losses: '+Number(l).toLocaleString("en",{minimumFractionDigits:2})+' ISK</div><div class="kill">[+/-]: '+Number(e-l).toLocaleString("en",{minimumFractionDigits:2})+" ISK</div>")}else{if((e-l)<0){$("#diff").append('<div class="kill">Kills: '+Number(e).toLocaleString("en",{minimumFractionDigits:2})+' ISK</div><div class="loss">Losses: '+Number(l).toLocaleString("en",{minimumFractionDigits:2})+' ISK</div><div class="loss">[+/-]: '+Number(e-l).toLocaleString("en",{minimumFractionDigits:2})+" ISK</div>")}}clearTimeout(g)}});return false}$("#form-container").submit(loadData);$(document).ready(function(){loadData()});